import React from 'react';
import './App.css';
import VideoCard from './VideoCard';

function App() {
  return (
    <div className="app">
      <h1>Let's begin!</h1>

      <div className="app__top">
      {/* image at the top */}
      <img
        className="app__log"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Instagram_logo_2016.svg/768px-Instagram_logo_2016.svg.png"
        alt=""
        />
        <h1>Reels</h1>
      {/* Reels text */}
      </div>

      <div className="app__videos">

      {/* container of app__video(scroll) */}
      <VideoCard 
      channel='test'
      avatarSrc='https://upload.wikimedia.org/wikipedia/commons/7/7c/Profile_avatar_placeholder_large.png'
      song='test'
      url='https://scontent-ssn1-1.cdninstagram.com/v/t50.2886-16/117932784_329931645035937_7460453733854060462_n.mp4?_nc_ht=scontent-ssn1-1.cdninstagram.com&_nc_cat=109&_nc_ohc=Tn6WhLZ7rgMAX_vE_el&oe=5F88B53A&oh=bbc6d5ecf8da54937f31c2a20a668384'
      likes={950}
      shares={30} />
      <VideoCard />
      <VideoCard />
      <VideoCard />
      {/* video */}
      </div>
    </div>
  );
}

export default App;
